import ValueInput from './ExpenseForm/ValueInput';
import ExpenseDescriptionInput from './ExpenseForm/ExpenseDescriptionInput';
import ExpenseCurrencyInput from './ExpenseForm/ExpenseCurrencyInput';

class WalletExpenseForm extends Component {
  render() {
    return (
      <form>
        <ValueInput />
        <ExpenseDescriptionInput />
        <ExpenseCurrencyInput />
      </form>
    );
  }
}

export default WalletExpenseForm;
